import React, { useState } from 'react';

export default function Navbar() {
  const [open, setOpen] = useState(false); // Initialize state to false

  function toggleOpen() {
    setOpen((prevOpen) => !prevOpen); // Use functional state update
  }

  return (
    <div>
      {open && ( // Conditional rendering
        <h1>Here are the coming rules:</h1> // Content to show when open is true
      )}
      <button onClick={toggleOpen}>{open ? 'Hide Rules' : 'I Understand'}</button>
      {open && (
        <ul>
          <li>Rule 1: Be respectful</li>
          <li>Rule 2: No spamming</li>
          <li>Rule 3: Follow the guidelines</li>
        </ul>
      )}
    </div>
  );
}
